import React from 'react';
import axios from 'axios';
import { Socialmedia, Socialicon, Socialp, Socialinfo, Face, Twitter, Pin } from './style.js';
const SocailMedia = () => {
    const Socails = () => {
        const [social, setSocail] = useState([])
        useEffect(() => {
            axios.get('js/data.json').then(res => { setSocail(res.data.social) })
            
        }, []);
            
        const SocailList = Socails.map((item) => {
            return (
                <Face>
                    <Socialicon className="icon fa fa-facebook fa-lg" />
                    <Socialp>
                        <span className="info1">Follow Me on</span>
                        <Socialinfo>Social Facebook</Socialinfo>
                    </Socialp>
                </Face>
            );
        });
        return (
            <Socialmedia>
                <Face>
                    <Socialicon className="icon fa fa-facebook fa-lg" />
                    <Socialp>
                        <span className="info1">Follow Me on</span>
                        <Socialinfo>Social Facebook</Socialinfo>
                    </Socialp>
                </Face>

                <Twitter>
                    <Socialicon className="icon fa fa-twitter fa-lg" />
                    <Socialp>
                        <span className="info1">Tweet Me on</span>
                        <Socialinfo>Social twitter</Socialinfo>
                    </Socialp>
                </Twitter>

                <Pin>
                    <Socialicon className="icon fa fa-pinterest fa-lg" />
                    <Socialp>
                        <span className="info1">Pin Me on</span>
                        <Socialinfo>Social Pinterest</Socialinfo>
                    </Socialp>
                </Pin>
            </Socialmedia>
        );
    };
}
export default SocailMedia;
